import React from 'react';


type ToDolistType = {
    title:string
    task:Array<TaskType>
}

type TaskType = {
    id:number;
    title:string;
    isDone:boolean
}


export  const ToDolist = (props:ToDolistType) => {



    return (
        <div>
            <h3>{props.title}</h3>
            <input/>
            <button>Add</button>
            <div >
                {props.task.map((el)=>{
                    return (
                        <li key={el.id}>
                            {el.title}
                            <input type={"checkbox"} checked={el.isDone}/>
                            <button>x</button>
                        </li>

                    )

                })}

            </div>

        </div>
    );
};
